(16, 1, '2017-08-24 09:54:15', '2017-08-24 06:54:15', 'Компания «Новый город» динамично развивается на рынке недвижимости Центрального федерального округа и имеет репутацию надёжного девелопера. Объекты жилой и коммерческой недвижимости, реализуемые совместно с партнерами «Нового города» известны жителям Тульской, Калужской и Рязанской областей. В общем счёте специалисты компании приняли участие в реализации около тридцати проектов общей площадью свыше 500 тысяч квадратных метров.\r\n\r\nБлагодаря реализуемым и реализованным проектам компания помогает обрести доступное, уютное жилье тем самым улучшая качество жизни людей. Объекты наполняют облик городов новым смыслом, смыслом перемен к лучшему. Мы даем людям уверенность и надежность, помогая реализовать их мечты о комфортной жизни в современном мире.', 'История компании', '', 'publish', 'closed', 'closed', '', '%d0%b8%d1%81%d1%82%d0%be%d1%80%d0%b8%d1%8f-%d0%ba%d0%be%d0%bc%d0%bf%d0%b0%d0%bd%d0%b8%d0%b8', '', '', '2017-08-24 09:54:15', '2017-08-24 06:54:15', '', 0, 'http://newcity/?page_id=16', 0, 'page', '', 0),
(17, 1, '2017-08-24 09:54:15', '2017-08-24 06:54:15', 'Компания «Новый город» динамично развивается на рынке недвижимости Центрального федерального округа и имеет репутацию надёжного девелопера. Объекты жилой и коммерческой недвижимости, реализуемые совместно с партнерами «Нового города» известны жителям Тульской, Калужской и Рязанской областей. В общем счёте специалисты компании приняли участие в реализации около тридцати проектов общей площадью свыше 500 тысяч квадратных метров.\r\n\r\nБлагодаря реализуемым и реализованным проектам компания помогает обрести доступное, уютное жилье тем самым улучшая качество жизни людей. Объекты наполняют облик городов новым смыслом, смыслом перемен к лучшему. Мы даем людям уверенность и надежность, помогая реализовать их мечты о комфортной жизни в современном мире.', 'История компании', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2017-08-24 09:54:15', '2017-08-24 06:54:15', '', 16, 'http://newcity/2017/08/24/16-revision-v1/', 0, 'revision', '', 0),
